class DocFilterer:
    def __init__(self, root_path, split, id_list):
        self.root_path = os.path.join(root_path, split)
        self.split = split
        self.id_list = id_list
        self.root_to_files = {}

    def ignore_ids(self):
        self.update_files_tofind()
        file_list = self.get_file_names()
        self.rename_files(file_list)

    def rename_files(self, full_path_list):
        renamed_count = 0
        for file_name in full_path_list:
            os.rename(file_name, file_name+".ignored")
            renamed_count += 1
        print("Renamed files: ", renamed_count)

    def update_files_tofind(self):
        print("Going to look for ", len(self.id_list), " files.")
        if not self.root_to_files:
            for root, dirnames, file_names in os.walk(self.root_path):
                file_ids = [int(file_name.split(".")[0].split("-")[1]) for file_name in file_names]
                self.root_to_files[root] = file_ids
            existing_file_ids = self.root_to_files.values()
            # flatten the list
            existing_file_ids = list(itertools.chain(*existing_file_ids))
            missing_file_ids = set(self.id_list) - set(existing_file_ids)
            print("The following file ids are missing: ", len(missing_file_ids), missing_file_ids)
            self.id_list = set(self.id_list) - missing_file_ids

    def get_file_names(self):
        full_path_names = []
        for doc_id in self.id_list:
            full_path_name = self.find_file(doc_id)
            full_path_names.append(full_path_name)
        return full_path_names

    def find_file(self, doc_id):
        root = [key for key, id_list in self.root_to_files.items() if doc_id in id_list][0]
        file_name = self.split + "-" + str(doc_id) + ".txt.tree"
        return os.path.join(root, file_name)


if __name__ == '__main__':
    root_path = sys.argv[1]

    train_filter = DocFilterer(root_path, "train", ids_train)
    train_filter.ignore_ids()

    dev_filter = DocFilterer(root_path, "dev", ids_dev)
